$(function () {
    completion();
})

function completion() {
    for (var property in info) {
        var value = info[property];

        if (property == "basic" || property == "school" || property == "train") {
            for (var item in value) {
                var itemClass = "." + property + "-" + item;
                var itemValue = value[item]

                filler(itemValue, itemClass);
            }
        }
        else if (property == "companies") {
            $(value).each(function (index, company) {
                var companyClass = ".company-" + (index + 1);
                var periodClass = companyClass + "-period";
                var nameClass = companyClass + "-name";

                filler(company.period, periodClass);
                filler(company.name, nameClass);
            })
        }
        else if (property == "projects") {
            $(value).each(function (index, project) {
                var projectClass = ".project-" + (index + 1);
                var periodClass = projectClass + "-period";

                for (var item in project) {
                    if (item == "period") {
                        filler(project[item], periodClass);
                    }
                    else {
                        $(project[item]).each(function (index, otherItem) {
                            var otherItemClass = projectClass + "-" + item + "-" + (index + 1);

                            filler(otherItem, otherItemClass);
                        });
                    }
                }
            })
        }
        else if (property == "abilities") {
            $(value["words"]).each(function (index, item) {
                var itemClass = "." + property + "-" + "words" + "-" + (index + 1);
                var nameClass = itemClass + "-name";
                var introduceClass = itemClass + "-introduce";

                filler(item.name, nameClass);
                filler(item.introduce, introduceClass);
            })

            $(value["specialties"]).each(function (index, item) {
                var itemClass = "." + property + "-" + "specialties" + "-" + (index + 1);
                var introduceClass = itemClass + "-introduce";

                $(item["introduce"]).each(function (introduceIndex, introduceItem) {
                    var introduceItemClass = introduceClass + "-" + (introduceIndex + 1);

                    filler(introduceItem, introduceItemClass);
                })
            })
        }
        else if (property == "certificates") {
            $(value).each(function (index, certificate) {
                var certificateClass = ".certificate-" + (index + 1);
                var nameClass = certificateClass + "-name";
                var codeClass = certificateClass + "-code";

                filler(certificate.name, nameClass);
                filler(certificate.code, codeClass);
            })
        }
        else if (property == "patents") {
            $(value).each(function (index, patent) {
                var patentClass = ".patent-" + (index + 1);
                var nameClass = patentClass + "-name";
                var codeClass = patentClass + "-code";

                filler(patent.name, nameClass);
                filler(patent.code, codeClass);
            })
        }
        else if (property == "evaluate") {
            var evaluateClass = ".evaluate";

            filler(value, evaluateClass);
        }
        else if (property == "download") {
            var downloadClass = ".download";
            var text = decode(value);
            $(downloadClass).attr("download", text);
        }
    }
}

function filler(text, target) {
    text = decode(text);

    var head = $("head");
    var style = $('<style type="text/css"></style>');
    style.text(target + '::after { content: "' + text + '"; }');
    head.append(style);
}

function decode(source) {
    source = atob(source);
    source = decodeURI(source);

    return source;
}

